import React ,{useState} from 'react';
import './Main.css';
import Button from '../Buttons/Button';
export default function Main(){

    
    const [state,chState] = useState(true);
    console.log(state);

    const l1=["C","±","%","÷"];
    const l2=["9","8","7","×"];
    const l3=["6","5","4","-"];
    const l4=["3","2","1","+"];
    const l5=["0","."," ","="];
    const color=["#898989","#F0F0F3","#2DD3C5"];

    return(
        <>
        <div className="main">
                <div className="top" >
                          <div className="history" id='his'></div>
                          <div className="med" id='med'></div>
                         <div className="screen" id='top'> 

                         </div>
                </div>
                <div className="bottom" id='bottom'>
                    <Button text1={l1[0]} text2={l1[1]} text3={l1[2]} text4={l1[3]} color={color[0]} state={state} ch={chState}/>
                    <Button text1={l2[0]} text2={l2[1]} text3={l2[2]} text4={l2[3]} state={state}/>
                    <Button text1={l3[0]} text2={l3[1]} text3={l3[2]} text4={l3[3]} state={state}/>
                    <Button text1={l4[0]} text2={l4[1]} text3={l4[2]} text4={l4[3]} state={state}/>
                    <Button text1={l5[0]} text2={l5[1]} text3={l5[2]} text4={l5[3]} colorText={color[1]} bg={color[2]} state={state}/>
                </div>
        </div>
        </>
    )
}
